import React from "react";
import lantern from "../../images/lantern.png";
import linkedin from "../../images/linkedin.png";
import github from "../../images/github.png";
import email from "../../images/email.png";
import light from "../../images/light.png";

const Footer = () => {
  return (
    <div
      id="footer"
      className=" md:h-96 bg-footer grid md:grid-cols-2 md:items-center justify-center -mt-1 -mb-1"
    >
      <div className="flex justify-center md:justify-end items-end md:p-4 ">
        <img
          src={lantern}
          alt=""
          className=" -z-1 w-40 md:w-60 mt-20 md:mt-0 animate-pulse"
        />
      </div>
      <div className="absolute justify-center md:justify-end items-end md:p-4 ">
        <img
          src={light}
          alt=""
          className=" -z-1 w-40 md:w-60 mt-20 md:mt-0 "
        />
      </div>
      <div className=" mb-20 md:mb-0 p-4 ">
        <div className="flex pt-4 gap-2 pb-3 justify-center md:justify-start">
          <a href="##">
            <img src={linkedin} alt="" className="w-10" />
          </a>
          <a href="##">
            <img src={github} alt="" className="w-10" />
          </a>
          <a href="##">
            <img src={email} alt="" className="w-10" />
          </a>
        </div>
        <h1 className="text-sm text-center md:text-left">
          Built &amp; Designed by Hanson Liao
        </h1>
        <h1 className="text-sm text-center md:text-left">Updated July 2023</h1>
      </div>
    </div>
  );
};

export default Footer;
